import React from "react";

const FoundView = ({ foundSearch }) => {
  // console.log(foundSearch);
  const searchResult =
    foundSearch &&
    foundSearch.map((values, i) => {
      if (values.length) {
        const { address, imageSrc, url, city, category } = values;
        return (
          <div key={i}>
            <div>
              <img
                src={imageSrc}
                alt={category}
                style={{ width: "250px", height: "250px" }}
              />
            </div>
            <address>{address}</address>
            <cite>{city}</cite>
            <br />
            <a href={url}>view in page</a>
          </div>
        );
      } else {
        return <div>loading...</div>;
      }
    });
  // ) : (
  //   <div>{null}</div>
  // );

  return (
    <div style={{ width: "100%" }}>
      <div
        style={{
          display: "flex",
          justifyContent: "space-around",
          flexWrap: "wrap"
        }}
      >
        {searchResult}
      </div>
    </div>
  );
};

export default FoundView;
